css:
@-moz-document domain("gofundme.com") {
body
{
    background: none;
}

body, 
.m-alert-banner--cookie,
.pg-account-norma,

.a-select-options,

.donationcommentbox--ugc .comment,

.donationform .dropdown, .gfm_lb_main
{
    background-color: #333;
}

html,
.t-campaign-page-header-top,
footer,
.a-progress-bar,
.top-navigation-container--solid,

[type=color], [type=date], [type=datetime-local], [type=datetime], [type=email], [type=month], [type=number], [type=password], [type=search], [type=tel], [type=text], [type=time], [type=url], [type=week], textarea,

.card, .category-arrows-contain, .header-sub, .layer-theme, .layer-white, .link-bar, .pg-campaign-mgmt .action-card, .pg-campaign-mgmt .layer-white-btn, .pg-campaign-mgmt .unreplied-donation-message,
.top-bar, .top-bar-nav-icon, .top-bar-menu, .top-bar-menu::before,

.breadcrumb-list,

.m-dropdown-content,

.o-modal-inner,

.hd, .donationamount, .zeros, .dollarsign, .donationcommentbox .photo, .headbar, .section_head, .doner .rewbox, .light-bkgd, .reward .title, .wishlist .title, .rewardna:hover .title, .donationform .autocomplete a:hover, .selected, .gfm_dropdown_option:hover, .gfm_dropdown_option.odd:hover, .greencontainer, .donationform .dropdown .odd.selected, .donationcommentbox.donationcommentbox--ugc, .donationform .country, .gfm_lb_main .head, .gfm_lb_main .lrgbtn

{
    background-color: #222;
}

.p-campaign-sidebar .o-campaign-sidebar,
.funds-contain--tiles-grid .react-campaign-tile,
.content-section--tan,
.content-container-white, .word-line-break span,

.campaign-action-tile,
.fundcreation-react-render .amount-contain-row, .amount-contain, .writing-tips-title-bar,

.a
{
    background-color: #444;
}

.m-comment-footer,
.react-campaign-tile-details,
.amount-input
{
    background: none;
}

.o-campaign-story:after
{
    background: linear-gradient(180deg,rgba(251,248,246,0) 0,#333);
}

.solid-line
{
    border-color: #0000;
}

body,
.text-stat-value,
.text-black,
.fund-title,
.dropdown-lvl1-link,

.campaign-action-tile-title,

label, select,

.o-update-list-item:first-child .m-update-content,

.m-dropdown-link,

.details .time span, .label, .details .raised, .smallcopy, .hd .menu,

input
{
    color: #ccc !important;
}

.o-global-header,
.m-alert-banner--cookie,
.o-donation-list-item:not(:last-child),
.o-comments-list-item:not(:last-child),
.a-rule--horizontal,
.react-campaign-tile,

.content-container-header,
.content-container-footer,

[type=color], [type=date], [type=datetime-local], [type=datetime], [type=email], [type=month], [type=number], [type=password], [type=search], [type=tel], [type=text], [type=time], [type=url], [type=week], textarea,

.campaign-action-tile-content, .writing-tips-title-bar,

.a-select-options, .m-dropdown-heading, .m-dropdown-more,

.processdonation, .details, .aboutorganizer, .a, .headbar, .dollarsign, .zeros, .donationform input, .donationform .country, .donationcommentbox, .donationcommentbox--ugc .comment, .donationcomment-add-photo, .donationform .dropdown, .donationform .dropdown a, .hd, .gfm_lb_main .head, .gfm_lb_main .lrgbtn

{
    box-shadow: none;
    border: none;
}

.amount-tips-contain:after, .writing-tips-contain:after
{
    border-right-color: #222;
}

.details .bar,
.details .bar .fill
{
    filter: invert(1);
}
}
